import axios from "axios";

const url = "https://api.github.com/users/";

const Fetch = async ({ username }) => {
  try {
    const data = await axios.get(url / `${username}`);
    console.log(data);
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
